import React from "react"
import MenuItem from "../menu-item/menu-item";

class Directory extends React.Component {
    constructor() {
        super();

        this.state ={
            sections: [{
                title: "Hats",
                ImageUrl: "https://i.ibb.co/cvpntL1/hats.png",
                id: 1
            },
            {
                title: "Jackets",
                ImageUrl: "https://i.ibb.co/cvpntL1/jackets.png",
                id: 2
            },
            {
                title: "sneakers",
                ImageUrl: "https://i.ibb.co/cvpntL1/sneakers.png",
                id: 3
            },
            {
                title: "mens",
                ImageUrl: "https://i.ibb.co/cvpntL1/mens.png",
                id: 4
            },
            {
                title: "womens",
                ImageUrl: "https://i.ibb.co/cvpntL1/womens.png",
                id: 5
            },        
        ]}

    }
    render() {
        return (
            <div>
               { this.state.sections.map(sections => (
                   <MenuItem key={sections.id} title={sections.title} ImageUrl={sections.ImageUrl}  />
               )) }
            </div>
        )
    }

}

export default Directory;
